--
-- Table structure for table `inventory_current_locations`
--

DROP TABLE IF EXISTS `inventory_current_locations`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `inventory_current_locations` (
  `id` int NOT NULL AUTO_INCREMENT,
  `item_type` enum('gauge','tool','part','equipment','material') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `item_identifier` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `current_location` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `quantity` int NOT NULL DEFAULT '1' COMMENT 'Always 1 for gauges/tools, variable for parts',
  `last_moved_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `last_moved_by` int NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_item_location` (`item_type`,`item_identifier`,`current_location`),
  KEY `idx_location` (`current_location`),
  KEY `idx_item` (`item_type`,`item_identifier`),
  KEY `last_moved_by` (`last_moved_by`),
  CONSTRAINT `inventory_current_locations_ibfk_1` FOREIGN KEY (`current_location`) REFERENCES `storage_locations` (`location_code`) ON DELETE RESTRICT,
  CONSTRAINT `inventory_current_locations_ibfk_2` FOREIGN KEY (`last_moved_by`) REFERENCES `core_users` (`id`) ON DELETE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=212 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Current item locations - single source of truth for ALL items including parts';
/*!40101 SET character_set_client = @saved_cs_client */;

