--
-- Table structure for table `storage_locations`
--

DROP TABLE IF EXISTS `storage_locations`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `storage_locations` (
  `id` int NOT NULL AUTO_INCREMENT,
  `location_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Unique location code (e.g., A1, SHELF-A1, RACK-1-BIN-3)',
  `building_id` int DEFAULT NULL,
  `zone_id` int DEFAULT NULL,
  `location_type` enum('bin','shelf','rack','cabinet','drawer','room','other') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT 'bin' COMMENT 'Type of storage location',
  `is_active` tinyint(1) DEFAULT '1' COMMENT 'Whether this location is currently in use',
  `display_order` int DEFAULT '0' COMMENT 'Order for display in dropdowns',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `allowed_item_types` json DEFAULT NULL COMMENT 'Types of items allowed in this location (gauges, tools, parts)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `location_code` (`location_code`),
  KEY `idx_active` (`is_active`),
  KEY `idx_type` (`location_type`),
  KEY `idx_display_order` (`display_order`),
  KEY `idx_building_id` (`building_id`),
  KEY `idx_zone_id` (`zone_id`),
  CONSTRAINT `fk_storage_location_building` FOREIGN KEY (`building_id`) REFERENCES `buildings` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_storage_location_zone` FOREIGN KEY (`zone_id`) REFERENCES `zones` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=68 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Configurable storage locations for gauges and equipment';
/*!40101 SET character_set_client = @saved_cs_client */;

